import React, {Component} from 'react';

export default class Form extends Component{
	constructor(props){
		super(props);
		this.handleForm = this.handleForm.bind(this);
	}

	handleForm(t,d,p){

	}

	render(){
		return(
			<div>
				<form>
					Title: <input type='text' id='titleForm' /><br/>
					Description <input type='text' id='descForm' /><br/>
					Date Posted <input type='date' id='dateForm' /><br/>	
					<button onClick={()=> this.handleForm(t,d,p)} type='submit'>Submit</button>
				</form>
			</div>
		)
	}
}
